//SPDX-License-Identifier: MIT

pragma solidity 0.8.6;

import "@openzeppelin/contracts/access/Ownable.sol";

abstract contract IAccountManager
{
    struct User
    {
        string name;
        string publicKey;
        bool isAuthority;
        bool exist;
    }

    function getPasswordMaster() public virtual view returns(string memory);

    function addUser(string memory name, string memory pubKey, string memory passwordMaster) public virtual returns(User memory);

    function addAuthority(string memory passwordMaster, address authorityAddress, string memory name, string memory pubKey) public virtual returns(User memory);

    function getUser(address userAddress) public virtual view returns(User memory);

    function setUser(string memory name) public virtual returns(User memory);

    function delUser() public virtual;

    function isAuthority(address userAddress) public virtual view returns(bool);

    function checkIfUserExist(address userAddress) public virtual view  returns(bool);
}
